import React from "react";
import { Typography, Box } from "@mui/material";

const MindMapPage = () => {
  return (
    <Box sx={{ padding: 4 }}>
      <Typography variant="h4" gutterBottom>
        Mind Map Visualization
      </Typography>
      <Typography>
        This is where your generated mind map will be displayed.
      </Typography>
      {/* You can replace this with your mind map rendering logic */}
    </Box>
  );
};

export default MindMapPage;
